,{i,Length[Objects4F]}];

Redundant=Flatten[Redundant];
SubRedundant=Dispatch[Flatten[SubRedundant]];

ParametersSMEFT=DeleteCases[SMEFTParametersTotal,Alternatives@@Redundant];
ParametersLEFT=DeleteCases[LEFTParametersTotal,Alternatives@@Redundant];

(* Auxiliary dispatch to convert a parameter into a function of t *)
insertt=Dispatch[(#->#[t])&/@Join[ParametersSMEFT,ParametersLEFT]];

];


CreateOperators:=Block[{repSMEFT,repLEFT},

repSMEFT=#[[2]]->#[[3]]&/@SMEFTObjectList//Dispatch;
repLEFT=#[[2]]->#[[3]]&/@LEFTObjectList//Dispatch;

SMEFTOperators=Replace[ParametersSMEFT,repSMEFT,{1,2},Heads->True];
LEFTOperators=Replace[ParametersLEFT,repLEFT,{1,2},Heads->True];

SMEFTOperatorsTotal=Replace[SMEFTParametersTotal,repSMEFT,{1,2},Heads->True];
LEFTOperatorsTotal=Replace[LEFTParametersTotal,repLEFT,{1,2},Heads->True];

];


NIndependent[par_]:=Block[{objlist,pos,nF,ind,cat,parRC},

(* Determine EFT *)
If[MemberQ[ParametersSMEFT,par]||MemberQ[ParametersLEFT,par],

If[MemberQ[ParametersSMEFT,par],
(* SMEFT *)
objlist=SMEFTObjectList;
,
(* LEFT *)
objlist=LEFTObjectList;
];

pos=Position[objlist[[All,1]],par][[1,1]];
nF=Length[objlist[[pos,5]]];
ind=Switch[nF,1,0,2,GetArgs[par],4,GetArgs[par]];
cat=objlist[[pos,4]];

If[nF==1,parRC=1];

If[nF==2,

Switch[cat,
1,parRC=2,  (* general 3x3 matrix *)
2,If[MemberQ[indices2Im,ind],parRC=2,parRC=1], (* Hermitian 3x3 matrix *)
3,parRC=2,  (* symmetric 3x3 matrix *)
4,parRC=2  (* antisymmetric 3x3 matrix *)
];

];

If[nF==4,

Switch[cat,
5,parRC=2, (* general 3x3x3x3 object *)
6,If[MemberQ[indices6Im,ind],parRC=2,parRC=1], (* two identical XX currents non-singlets *)
7,If[MemberQ[indices7Im,ind],parRC=2,parRC=1], (* two independent XX currents *)
8,If[MemberQ[indices8Im,ind],parRC=2,parRC=1], (* two identical XX currents singlets *)
9,parRC=2, (* symmetric current \[Times] general current *)
10,parRC=2, (* antisymmetric current \[Times] general current *)
11,parRC=2, (* SMEFT special case qqql *)
12,parRC=2, (* LEFT special case \[CapitalDelta]L = 4 *)
13,parRC=2 (* LEFT special cases dddSLL and dddSRR *)
];

];

Return[parRC];

,

If[MemberQ[SMEFTParametersTotal,par]||MemberQ[LEFTParametersTotal,par],
(* Redundant parameter *)
Return[0];
,
(* Non-existent parameter *)
Message[NIndependent::WrongParameter,par];
];

];

];


