(* Function to rewrite the SMEFT WCs as strings following the WCXF conventions *)
WCXFStringSMEFT[sym_]:=Block[{},
res=StringReplace[ToString[sym],{"C"->"","H"->"phi","box"->"Box","CHD"->"HD",StringExpression["[",a___,"]"]:>"_"<>StringDelete[ToString[a],", "]}];
Return[res];
];


(* Function to rewrite the LEFT WCs as strings following the WCXF conventions *)
WCXFStringLEFT[sym_]:=Block[{},
res=StringReplace[ToString[sym],{RegularExpression["(?m)^L"]->"","N"->"nu","\[Nu]"->"nu","\[Gamma]"->"gamma","U"->"u","D"->"d","E"->"e",StringExpression["[",a___,"]"]:>"_"<>StringDelete[ToString[a],", "]}];
If[StringContainsQ[res,"S1"],res="S1"<>StringDrop[res,StringPosition[res,"S1"][[1]]]];
If[StringContainsQ[res,"S8"],res="S8"<>StringDrop[res,StringPosition[res,"S8"][[1]]]];
If[StringContainsQ[res,"V1"],res="V1"<>StringDrop[res,StringPosition[res,"V1"][[1]]]];
If[StringContainsQ[res,"V8"],res="V8"<>StringDrop[res,StringPosition[res,"V8"][[1]]]];
If[StringContainsQ[res,"S"],res="S"<>StringDrop[res,{StringPosition[res,"S"][[1,1]]}]];
If[StringContainsQ[res,"V"],res="V"<>StringDrop[res,{StringPosition[res,"V"][[1,1]]}]];
If[StringContainsQ[res,"T"],res="T"<>StringDrop[res,{StringPosition[res,"T"][[1,1]]}]];
Return[res];
];


CreateWCsWCXF:=Block[{},
SMEFTWCsWCXF=WCXFStringSMEFT/@ParametersSMEFT[[First[SMEFTFindParameter[CG]];;-1]];
LEFTWCsWCXF=WCXFStringLEFT/@ParametersLEFT[[First[LEFTFindParameter[LG]];;-1]];
];


ObjectInfo[x_]:=Block[{pos,op,EFT,WCname,dim,class,sym,type,nn,cat,herm,ind,list,latex1,latex2},

(* Find object *)
If[Position[ObjectList,x]!={},
pos=Position[ObjectList,x][[1,1]];
op=ObjectList[[pos,3]]//ToString;
latex1=ObjectList[[pos,-2]];
latex2=ObjectList[[pos,-1]];

(* Determine properties *)
EFT=ObjectList[[pos,7]];
WCname=ObjectList[[pos,2]]//ToString;
dim=ObjectList[[pos,6]]//ToString;
class=ObjectList[[pos,8]];
If[Length[ObjectList[[pos,9]]]>1,sym=StringJoin[StringRiffle[ObjectList[[pos,9]][[1;;-2]], ", "]," and ",ObjectList[[pos,9]][[-1]]];,sym=ObjectList[[pos,9]]];
If[Length[ObjectList[[pos,5]]]==1,type="0F";nn="None"];
If[Length[ObjectList[[pos,5]]]==2,type="2F";nn=ToString[ObjectList[[pos,5,1]]]<>"\[Times]"<>ToString[ObjectList[[pos,5,2]]];];
If[Length[ObjectList[[pos,5]]]==4,type="4F";nn=ToString[ObjectList[[pos,5,1]]]<>"\[Times]"<>ToString[ObjectList[[pos,5,2]]]<>"\[Times]"<>ToString[ObjectList[[pos,5,3]]]<>"\[Times]"<>ToString[ObjectList[[pos,5,4]]];];
cat=ObjectList[[pos,4]]//ToString;
herm=If[MemberQ[{0,2,6,7,8},ObjectList[[pos,4]]],"Hermitian Operator","Non-Hermitian Operator"];
ind=If[type=="0F",1,Count[Flatten[ObjectList[[pos,1]]-(ObjectList[[pos,1]]//.SubRedundant)],0]];
list=Flatten[{ObjectList[[pos,1]]}];

Return[
Framed[Grid[{
{Framed[Grid[{{latex1,Text[Style["=",FontSize->15]],latex2}}],Background->LightYellow]},
{Framed[Style[op,20,Purple],Background->LightYellow]},
{Style["\nEFT: "<>EFT,16,Black]},
{Style["Wilson Coefficient: "<>WCname,16,Black]},
{Style["Dimension: "<>dim,16,Black]},
{Style["Class: "<>class,16,Black]},
{Style["Type: "<>type,16,Black]},
{Style["Index symmetry category: "<>cat,16,Black]},
{Style[herm,16,Black]},
{Style["Broken symmetries: "<>sym,16,Black]},
{Style["Number of independent coefficients: "<>ToString[ind],16,Black]},
{Style["Flavor indices: "<>nn<>"\n",16,Black]},
{Style[WCname<>" elements:",16,Black]},
{StringJoin[
Table[If[MemberQ[Symbol[EFT<>"ParameterList"][],list[[i]]],ToString[list[[i]]]<>"\n",StringJoin[ToString[list[[i]]]," = ",ToString[list[[i]]//.SubRedundant,InputForm]<>"\n"]],{i,Length[list]}]]}
},Alignment->Left,Spacings->{0,0.6}],Background->GrayLevel[0.9]]
],

Message[ObjectInfo::WrongOperator,ToString[x]];
];
];


